import React, {Component} from 'react';
import './App.css';
import { ReactComponent } from '*.svg';

function Input(){
  return (
    <div>
      <lable>First Name</lable>
    <input type="text" placeholder="name"/>
    <br/>
    <input type="text" placeholder="address"/>
    <br/>
    <br/>
    </div>
    ); 
}
function Button(){
  return(
    <div>
      <button type="submit">Submit</button>
    </div>
  )

}
function Header(){
  return(
  <div class="first">
    <h1>Sample Website</h1>
    <p>practice one</p>
  </div>
  );

}
function Footer(){
  return(
    <div class="head">
    <h1>Sample Website</h1>
    <p>practice one</p>
  </div>
  );

}
function Navibar()
{
  return(
  <div class="navbar">
  <a href="#">Home</a>
  <a href="#">Link1</a>
  <a href="#">Link2</a>
  <a href="#" class="right">Log out</a>
</div>
  );
}
class Test extends Component{
  render(){
    return(
      React.createElement('div',null,React.cloneElement('h1',null,'this is first'))
    );
  }
}
function App() {
  return (
    <div>
      {/* <Input />
      <Button /> */}
      <Header />
      <Navibar />
      <Test  />

    </div>
  );
}
export default App;



